import { useState } from "react";
import React, {Component} from "react";
import $ from "jquery";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      data: null,
    };
  }

  componentDidMount() {
    fetch('https://api.mydomain.com')
      .then(response => response.json())
      .then(data => this.setState({ data }));
  }
  App() {
      const [name, setName] = useState("");
      const [result, setResult] = useState("");

      return (
          <div className="App">
            <div className="topnav">
              <a className="non-clickable" href="#">The Star Wars API</a>
              <a className="links" href="http://localhost:8000/server.php">People</a>
              <a className="links" href="http://localhost:8000/server.php">Planets</a>
              <a className="links" href="http://localhost:8000/server.php">Starships</a>
            </div>
            <br></br>
            <div className="star-header first-header">Base API: 
              <a className="link-style" href="https://swapi.dev/documentation">The Star Wars API</a>
            </div>
            <div className="star-header">Built by: 
              <a className="link-style" href="https://github.com/athiraindrakumar396">Athira Indrakumar</a>
            </div>
            <div className="star-header">Code available in: 
              <a className="link-style" href="https://github.com/athiraindrakumar396">Github</a>
            </div>
              <h1>{result}</h1>
          </div>
      );
  }
}

export default App;
